// /// @DnDArgument : "code" "/// @description Render Text$(13_10)draw_text(x,y,"As you Escape on your boat from the nightmare you just endured,\n\nYour mind races to comprehend the events\n\nWhat were those creatures?\n\nWhere did they come from?\n\nWho could have been possibly responsible?\n\nYou think of any possible anwsers\n\nBut as you do, daylight comes\n\nProviding a sense of relief after a long night\n\nBut as you finally get a moment of relief\n\nSomething crosses your mind\n\nYou look at the root you have taken from the caverns\n\nThe long lost writing stated that it could provide life\n\nBut you realize this is what may have ultimately caused all of this\n\nWith that, you now know what you need to do\n\nThe boat has a furnace and some matches\n\nYou chuck the root into the furnace and light it\n\nDestroying the source of this nightmare\n\nAlthough this finally answers some questions\n\nThe question now becomes, what to do next\n\nYou figure with the source gone\n\nthe infected on the island will slowly die out\n\nSo you decide not to tell anyone about this when you return\n\nIf anyone asks, you're say you found nothing\n\nBut your work isn't done yet\n\nYou still need to find a plant that could provide life to your homeland\n\nYou have a few more leads\n\nWith that you, set off to hopefully one day find the plant\n\nBut you know that whatever comes next will be easier\n\n\n\nInfection Roots\n\nProgrammed and Created by Garrison K Smith (Jakeconer)\n\nPowered by Gamemaker Studio\n\nSound Effect by:\njsfxr\nLeshy SFMaker\n\nSpecial Thanks to the Indie Game Discord\nfor all the surport!\n\nand to you, the player\n\nPresented by Prospective Games\n\nThank You for Playing\n\nTHE END for Now!");" 
